$.ajax({url:`${BASE_URL}/baners`,method:"GET",success:function(e){$(".banner-atendimento").text(e.atendimentos),$(".banner-agendamento").text(e.agendamentos),$(".features-box").find(".placeholder-glow").each((function(){$(this).removeClass("placeholder-glow")})),$(".features-box").find(".placeholder").each((function(){$(this).removeClass("placeholder")}))}}),$.ajax({url:`${BASE_URL}/atendimentos?page=1`,method:"GET",success:function(e){$(".list-atendimento-recente").html(""),e.data.forEach((e=>{$(".list-atendimento-recente").append(`\n                <li>\n                    <div class="item-content">\n                        <a href="/detalhe/atendimento/${e.ate_codigo}" class="item-media">\n                            <i class="fa-solid fa-hospital fa-3x"></i>\n                        </a>\n                        <div class="item-inner">\n                            <div class="item-title-row">\n                                <div class="item-subtitle">Nome da Unidade</div>\n                                <h6 class="item-title">\n                                    <a href="/detalhe/atendimento/${e.ate_codigo}">${e.tis_nome}</a>\n                                </h6>\n                            </div>\n\n                            <div class="d-flex align-items-center mb-2">\n                                <i class="fa-solid fa-calendar-circle-user"></i>\n                                <div class="item-price">${moment(e.datahora).format("DD/MM/YYYY HH:mm:ss")}</div>\n                            </div>\n\n                            <div class="d-flex align-items-center">\n                                <i class="fa-solid fa-user-doctor"></i>\n                                <div class="item-price">${e.pro_nome}</div>\n                            </div>\n                        </div>\n                    </div>\n                </li>\n            `)}))}});
